import React, { useState } from 'react';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import IconButton from '@material-ui/core/IconButton';
import Collapse from '@material-ui/core/Collapse';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Avatar from '@material-ui/core/Avatar';
import MoreIcon from '@material-ui/icons/MoreVert';
import FavoriteIcon from '@material-ui/icons/Favorite';
import ShareIcon from '@material-ui/icons/Share';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import ExpandLessIcon from '@material-ui/icons/ExpandLess'; 
import { makeStyles } from '@material-ui/core/styles';
import Meghan from '../site-images/meghan.jpg';

const useStyles = makeStyles((theme) => ({
    card: {
        margin: 'auto',
        maxWidth: 450,
    },
    media: {
        height: 0,
        padding: '56.25%',
    },
}));

export default function Cards() {
    const classes = useStyles();

    return (
        <Card 
            className={classes.card} 
        >
            <CardMedia 
                className={classes.media} 
                component='img'
                src={Meghan} 
                alt='Meghan Gulvas' 
            />
            <CardContent>
                <Typography 
                    variant='h4' 
                >
                    Meghan
                </Typography>
                <Typography 
                    variant='body1' 
                    component='p'
                    color='textSecondary' 
                >
                    Meghan is a former law student from Indiana University.
                    She now works with the NCAA in Indianapolis and has developed 
                    a lot of experience in an intern and development role.
                </Typography>
            </CardContent>
            <CardActions>
                <Button 
                    color='primary' 
                >
                    Learn More 
                </Button>
                <Button 
                    color='primary' 
                >
                    Explore 
                </Button>
            </CardActions>
        </Card>
    );
}
